import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { CSSTransition } from 'react-transition-group';
import Home from './pages/Home';
import Progress from './pages/Progress';
import Explore from './pages/Exeplore';
import Profile from './pages/Profile';
import Messages from './pages/messeges';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import Register from './pages/Register';
import LoginPage from './pages/Login';
import Protected from './component/Routs/ProtectedHome';

function App() {
  const theme = createTheme({
    palette: {
      primary: {
        main: '#FFFFFF',
      },
      secondary: {
        main: '#0000FF',
      },
    },
  });
  return (
    <ThemeProvider theme={theme}>
      <Router>
        <div className="App">
          <Route
            render={({ location }) => (
              <TransitionGroup>
                <CSSTransition key={location.key} classNames="page" timeout={300}>
                  <Routes location={location}>
                    <Route path="/home" element={<Protected><Home/></Protected>} />
                    <Route path="/prof" element={<Protected><Profile /></Protected>} />
                    <Route path="/prog" element={<Protected><Progress /></Protected>} />
                    <Route path="/exp" element={<Protected><Explore /></Protected>} />
                    <Route path="/messeges" element={<Protected><Messages /></Protected>} />
                    <Route path="/register" element={<Register />} />
                    <Route path="/login" element={<LoginPage />} />
                  </Routes>
                </CSSTransition>
              </TransitionGroup>
            )}
          />
        </div>
      </Router>
    </ThemeProvider>
  );
}

export default App;
